import React from 'react';
import { Row, Col } from 'reactstrap';

import MapContainer from "./MapContainer";

const AnalyticsDashboardPage = () => {
    return (
        <React.Fragment>
            <Row>
                <Col>
                    <MapContainer />
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default AnalyticsDashboardPage;
